import global from "./global"

export default StyleSheet.create({
  ...global,

  container: {
    border: "1px solid black",
    // position: "absolute",
    right: "50%",
    display: "flex",
    // margin: "0 auto",
    padding: "20 10",
    padingTop: 5,
    width: "50%",
    height: "100%",
  },
})
